div.wpappbox *, div.wpappbox:after, div.wpappbox:before {
  -webkit-box-sizing: border-box;
  -moz-box-sizing: border-box;
  box-sizing: border-box
}

div.wpappbox a, div.wpappbox a:after, div.wpappbox:before {
  text-decoration: none !important;
  color: #323232;
  -webkit-transition-property: background color;
  -webkit-transition-duration: .2s;
  -webkit-transition-timing-function: ease;
  -moz-transition-property: background color;
  -moz-transition-duration: .2s;
  -moz-transition-timing-function: ease;
  -o-transition-property: background color;
  -o-transition-duration: .2s;
  -o-transition-timing-function: ease;
  transition-property: background color;
  transition-duration: .2s;
  transition-timing-function: ease
}

div.wpappbox a img {
  -webkit-transition: all .5s ease;
  -moz-transition: all .5s ease;
  -o-transition: all .5s ease;
  -ms-transition: all .5s ease;
  transition: all .5s ease
}

div.wpappbox a:hover img {
  opacity: .9;
  -ms-filter: "progid: DXImageTransform.Microsoft.Alpha(Opacity=90)";
  filter: alpha(opacity=90);
  -webkit-filter: grayscale(100%)
}

i.wpappbox-tinymce-button {
  background-image: url(../buttons/appbox.btn.png)
}

div.wpappbox {
  clear: both;
  font-family: 'Roboto', sans-serif;
  background-color: #F9F9F9;
  width: auto;
  line-height: 1;
  color: #545450;
  margin: 16px 0;
  font-size: 16px;
  border: 1px solid #E5E5E5;
  box-shadow: 0 0 8px 1px rgba(0, 0, 0, .11);
  border-radius: 8px
}

div.wpappbox.simple {
  height: 114px
}

div.wpappbox.compact {
  height: 68px
}

div.wpappbox.screenshots-only {
  cursor: pointer
}

div.wpappbox div.appicon {
  position: relative;
  height: 112px;
  width: 112px;
  float: left;
  padding: 10px;
  background: #FFF;
  text-align: center;
  border-right: 1px solid #E5E5E5;
  border-top-left-radius: 6px;
  border-bottom-left-radius: 6px
}

div.wpappbox.screenshots div.appicon {
  border-bottom-left-radius: 0
}

div.wpappbox.compact div.appicon {
  height: 66px;
  width: 68px;
  float: left;
  padding: 6px
}

div.wpappbox div.appicon img {
  height: auto;
  max-height: 92px;
  width: 92px;
  max-width: 92px;
  margin: auto;
  border: 0;
  border-radius: 6px
}

div.wpappbox.compact div.appicon img {
  height: auto;
  width: 54px;
  max-width: 54px;
  margin: auto;
  border: 0;
  border-radius: 6px
}

div.wpappbox.error div.appicon img {
  border-radius: 45px;
  box-shadow: -5px 6px 16px -3px rgba(50, 50, 50, .1)
}

div.wpappbox.deprecated div.appicon, div.wpappbox.deprecated div.screenshots {
  -webkit-filter: grayscale(100%);
  -moz-filter: grayscale(100%);
  -ms-filter: grayscale(100%);
  -o-filter: grayscale(100%);
  filter: grayscale(100%)
}

.wpappbox.deprecated div.appbuttons a {
  position: relative
}

.wpappbox.deprecated div.appbuttons a::after {
  content: "";
  display: block;
  position: absolute;
  bottom: 9px;
  left: 0;
  transform: skewY(-10deg);
  width: 100%;
  height: 1px;
  background: rgba(54, 54, 54, .5)
}

.wpappbox.deprecated .apptitle {
  text-decoration: line-through;
  text-decoration-line: line-through;
  text-decoration-color: rgba(54, 54, 54, .5)
}

div.wpappbox div.qrcode {
  display: none;
  position: absolute;
  padding: 6px;
  z-index: 999
}

div.wpappbox div.applinks, div.wpappbox.compact a.applinks {
  float: right;
  position: relative;
  background: #FFF;
  text-align: center;
  border-left: 1px solid #E5E5E5;
  border-top-right-radius: 6px;
  border-bottom-right-radius: 6px
}

div.wpappbox.screenshots a.applinks {
  border-bottom-right-radius: 0
}

div.wpappbox div.qrcode img {
  height: 100px;
  width: 100px;
  opacity: 1
}

div.wpappbox div.appdetails {
  font-size: 16px;
  line-height: 16px;
  padding-top: 10px
}

div.wpappbox.compact div.appdetails {
  font-size: 15px;
  line-height: 15px;
  padding-top: 6px
}

div.wpappbox div.appdetails > div {
  overflow: hidden;
  white-space: nowrap;
  text-overflow: ellipsis;
  -webkit-hyphens: none;
  -moz-hyphens: none;
  -ms-hyphens: none;
  hyphens: none;
  padding: 6px 8px
}

div.wpappbox.compact div.appdetails > div {
  padding: 4px 8px 1px
}

div.wpappbox div.apptitle {
  font-size: 19px;
  line-height: 19px;
  font-weight: 600;
  margin: 2px 0 0
}

