        var post_id = 0;
        if ($('body.single-post').length) {
            var classes = $('body').attr('class').split(' ');
            $(classes).each(function(idx, el) {
                if (el.indexOf('postid-') === 0) {
                    post_id = el.substr(7);
                }
            });
        }

        $.ajax({
            type: "POST",
            url: ajaxUrl,
            data: {
                action: 'lh_appbox_get_redis_record',
                app_id: $this.data('app-id'),
                store: $this.data('store'),
                show_screenshots: $this.data('show-screenshots'),
                old_price: $this.data('old-price'),
                post_id: post_id
            },
            timeout: reqTimeOut,
            headers: {
                'Authorization': "Basic " + btoa(username + ":" + password)
            },
            success: function (res) {
                if (res.success) {
                    $this.replaceWith(res.data);
                } else {
                    console.warn('Error when getting appbox from server', data);
                }
            },
            error: function (err) {
                console.error(err);
            }
        });
    });

    $doc.on('click', '.wpappbox .reload-link', function () {
        var $this = $(this);
        var $appBox = $this.parents('.wpappbox');

        var cursor = $this.css('cursor');
        $this.css('cursor', 'wait');

        $.ajax({
            type: "POST",
            url: ajaxUrl,
            data: {
                action: 'lh_appbox_remove_redis_record',
                redis_key: $this.data('redis-key'),
                app_id: $this.data('app-id'),
                store: $this.data('store'),
                show_screenshots: $this.data('show-screenshots'),
