jQuery(document).ready(function ($) {
  var serverUrl = 'https://twister.lifehacker.ru/';
  var $win = $(window);
  var defaultDisplayFreq = 30; //days
  var defaultCommonPopupBlockTime = 1; //days
  var secondsToAutoClosePopup = 15; //seconds
  var ns = 'twister';
  var ver = 1;
  var blockedPopupsAndBannersKey = ns + '_popups_and_banners_' + ver;
  var sessionPagesKey = ns + '_session_pages_' + ver;
  var closedPopupsCounterKey = ns + '_closed_popups_counter_' + ver;
  var commonPopupBlockKey = ns + '_common_disabled_popups_' + ver;
  var device = $win.width() > 1024 ? 'desktop' : 'mobile';
  var sessionPages = 1;
  var bannerContainerSelector = '.lh-twister';
  var beginTyping = false;
  var formIds = {
    'mail/daily': 'Daily',
    'mail/weekly': 'Weekly',
    'mail/aliexpress': 'Aliexpress'
  };

  try {
    // Storage actions
    updateSessionPages();
    checkCommonPopupsBlock();

    // REST API requests
    getRandomBannerAndInsert();

    // Event handlers
    sendEmailToLifehackerWpAjax();
    onScroll();
    onClick();
    onClose();
    toggleTyping();
    bannerClick();
  } catch (err) {
    console.warn(err);
  }

  function checkCommonPopupsBlock() {
    var timestamp;

    if (timestamp = localStorage.getItem(commonPopupBlockKey)) {
      timestamp = +timestamp;

      if (Date.now > timestamp + _getDaysInMs(defaultCommonPopupBlockTime))
        localStorage.removeItem(commonPopupBlockKey);
    }
  }


  function _isAbleToRequestPopup() {
    return !localStorage.getItem(commonPopupBlockKey);
  }

  function _getDaysInMs(days) {
    days = +days;
    return parseInt(days * 24 * 60 * 60 * 1000);
  }

  function _getSecondsInMs(seconds) {
    seconds = +seconds;
    return seconds * 1000;
  }

  function _isPopup(bannerData) {
    return (bannerData.display_type === 'popup' || bannerData.display_type === 'popup__template' )
  }

  function _close(bannerData) {
    if (bannerData.display_type === 'static' || bannerData.display_type === 'static__2fields')
      _closeBanner(bannerData);

    if (bannerData.display_type === 'popup' || bannerData.display_type === 'popup__template')
      _closePopup(bannerData);
  }

  function _closePopup(bannerData) {
    $('#lh-twister__' + bannerData.id)
    .attr('data-closed', 1)
    .hide();

    // Заблокируем этот попап
    _addToBlockedBanners(bannerData);
    // Заблокируем все попапы на
    _commonBlockPopups();

    // Удалим, чтобы поставилось по умолчания
    delete bannerData['display_freq'];
    _addToClosedPopups(bannerData);
  }

  function _closeBanner(bannerData) {
    $('#lh-twister__' + bannerData.id)
    .attr('data-closed', 1)
    .hide();
  }

  function updateSessionPages() {
    if (sessionPages = sessionStorage.getItem(sessionPagesKey)) {
      sessionPages = +sessionPages + 1;
      sessionStorage.setItem(sessionPagesKey, sessionPages);
    } else
      sessionStorage.setItem(sessionPagesKey, 1);
  }

  function getRandomBannerAndInsert() {
    $(bannerContainerSelector).each(function () {
      var $this = $(this);
      var req = $this.data('req');
      var cat_ids = req.cat_ids;
      var is_ad = req.is_ad;
      var display_type = req.display_type;
      var not_in = _getBannersToExclude();

      // Если нельзя запрашивать попапы, пропустим итерацию
      if ((display_type === 'popup' || display_type === 'popup__template') && !_isAbleToRequestPopup())
        return true;

      var respUrl = serverUrl;
      respUrl += '/api/banner/xhr-random?cat_ids=' + cat_ids;
      respUrl += '&is_ad=' + is_ad;
      respUrl += '&device=' + device;
      respUrl += '&display_type=' + display_type;
      respUrl += '&session_pages=' + (sessionPages || 1);
      if (not_in)
        respUrl += '&not_in=' + not_in;

      $.ajax({
        type: "GET",
        url: respUrl,
        timeout: 5000,
        success: function (resp) {
          if (resp.success) {
            var respDataForAttr = $.extend(true, {}, resp.data, {content: null, categories: null});
            respDataForAttr = JSON.stringify(respDataForAttr);
            var delayToShow = 0;
            var thisIsPopup = _isPopup(resp.data);

            if (thisIsPopup)
              delayToShow = resp.data.page_seconds * 1000;

            setTimeout(function () {
              $this
              .attr('data-id', resp.data.id)
              .attr('data-device', device)
              .attr('data-display-type', resp.data.display_type)
              .attr('data-resp', respDataForAttr)
              .attr('data-interacted', 0)
              .attr('data-viewed', 0)
              .attr('data-closed', 0)
              .attr('id', 'lh-twister__' + resp.data.id)
              .addClass('lh-twister__' + device)
              .html(resp.data.content);

              if (thisIsPopup && !$this.data('viewed')) {
                $this.data('viewed', 1);
                var bannerData = $this.data('resp');
                _sendEventToServer(bannerData, 'view');
              }

              if (thisIsPopup)
                setTimeout(function () {
                  if (!beginTyping && !$this.data('closed'))
                    _close(resp.data);
                }, _getSecondsInMs(secondsToAutoClosePopup));
            }, delayToShow);
          } else {
            // Do nothing
            $this.hide();
          }
        },
        error: function (err) {
          console.warn(err);
        }
      });
    });
  }

  function toggleTyping() {
    $(bannerContainerSelector).on('input', 'input[type="email"]', function () {
      if (beginTyping)
        return;

      var $this = $(this);
      var $bannerWrapper = $this.parents(bannerContainerSelector).first();
      var bannerData = $bannerWrapper.data('resp');
      var displayType = bannerData['display_type'];

      if (displayType === 'popup' || displayType === 'popup__template')
        beginTyping = true;
    });
  }

  function sendEmailToLifehackerWpAjax() {

    $(bannerContainerSelector).on('submit', 'form', function (event) {
      event.preventDefault();
      var $this = $(this);

      var $bannerWrapper = $this.parents(bannerContainerSelector).first();
      var bannerData = $bannerWrapper.data('resp');
      var displayType = bannerData['display_type'];
      var email = $this.find('input[type=email]').val();
      var type = $this.data('type') || "mail/weekly";
      var source = $this.data('source') || 'directed_banner';

      if ((displayType !== 'static' || displayType !== 'static__2fields') && source === 'directed_banner' )
        source = formIds[type];

      email = $.trim(email);

      if (!email)
        return;

      if ($('.twister__form').length) {
        $.ajax({
          type: $this.attr('method'),
          url: $this.attr('action'),
          data: $this.serialize(),
          cache: false,
          dataType: "jsonp",
          jsonp: "c",
          contentType: "application/json; charset=utf-8",

          success: function (data) {
            if (data.result !== 'success') {
              alert('Не удалось оформить подписку.');
              _sendEventToServer(bannerData, 'interaction');
            } else {
              $this.parents('.lh-twister').addClass('hidden');
              _sendEventToServer(bannerData, 'interaction');
              alert('Спасибо! Мы отправили на ваш адрес письмо со ссылкой, по которой необходимо перейти для подтверждения вашей подписки. Если не найдёте письмо, загляните в папку «Спам», возможно, оно там.');
              dataLayer.push({
                'event': 'passEventToGa',
                'eventCategory': 'Twister',
                'eventAction': $this.find('.twister-custom__title').text(),
                'eventLabel': window.location.href,
                'eventValue': 1})
            }
          },
          error: function (err) {
            alert('Не удалось оформить подписку.');
          }
        });
        return;
      }

      var action = "/wp-admin/admin-ajax.php";
      var data = {
        'action': 'mc_pages_add_email',
        'email': email,
        'page': type,
        'source': source
      };

      $.post(action, data, function (response) {
        if (response.success) {
          var emailStatus = String(response.data[0]);

          switch (emailStatus) {
            case '404':
              //новая подписка
              _sendEventToServer(bannerData, 'interaction');
              _asyncAlert('Спасибо! Мы отправили на ваш адрес письмо со ссылкой, по которой необходимо перейти для подтверждения вашей подписки. Если не найдёте письмо, загляните в папку «Спам», возможно, оно там.');
              _close(bannerData);
              break;

            case 'pending':
              //подписался, но не подтвердил
              _asyncAlert('На ваш почтовый ящик ранее было отправлено письмо для подтверждения. Проверьте почту. Если не найдёте письмо, загляните в папку «Спам», возможно, оно там.');
              break;

            case 'subscribed':
              if (response.data[1] === false) {
                //уже подписан
                _asyncAlert('Вы уже подписаны');
              } else {
                //сменил interest (daily/weekly)
                _sendEventToServer(bannerData, 'interaction');
                _asyncAlert('Вы успешно подписаны');
                _close(bannerData);
              }
              break;

            case 'unsubscribed':
              //переподписка (был отписан ранее)
              _sendEventToServer(bannerData, 'interaction');
              // _asyncAlert('Вы снова подписаны');
              _asyncAlert('Спасибо! Мы отправили на ваш адрес письмо со ссылкой, по которой необходимо перейти для подтверждения вашей подписки. Если не найдёте письмо, загляните в папку «Спам», возможно, оно там.');
              _close(bannerData);
              break;

            default:
              _asyncAlert('Ошибка. Попробуйте позже.');
              console.warn('error 1');
              break;
          }

        } else {
          _asyncAlert('Ошибка. Попробуйте позже.');
          console.warn('error 2');
        }
      });
    });
  }

  function onScroll() {
    $win.on('scroll', function () {
      $(bannerContainerSelector).each(function () {
        var $this = $(this);
        var el = $this[0];

        if (
            _elementInViewport(el) &&
            !$this.data('viewed')
        ) {
