  }



  function bannerClick() {
    $(bannerContainerSelector).on('click', '.twister-banner', function () {
      var $this = $(this);
      var bannerData = $this.parent().data('resp');
      _sendEventToServer(bannerData, 'interaction');
      dataLayer.push({
        'event': 'passEventToGa',
        'eventCategory': 'Twister',
        'eventAction': 'Баннер ' + $this.attr("href"),
        'eventLabel': window.location.href,
        'eventValue': 1})
    })
  }

  function onClose() {
    $(bannerContainerSelector).on('click', '.lh-close', function () {
      var $this = $(this);
      var $bannerWrapper = $this.parents(bannerContainerSelector).first();
      var bannerData = $bannerWrapper.data('resp');
      _close(bannerData);
    });
  }

  function _addToBlockedBanners(bannerData) {
    var banners;
    var displayFreq = _getDaysInMs(180);

    // нет баннеров для исключения, создадим
    if (banners = localStorage.getItem(blockedPopupsAndBannersKey))
      banners = JSON.parse(banners);
    else
      banners = [];

    if (bannerData['display_type'] === 'static' || bannerData['display_type'] === 'static__2fields' )
      displayFreq = _getDaysInMs(bannerData['display_freq']) || _getDaysInMs(defaultDisplayFreq);

    banners.push({
      id: bannerData['id'],
      created: Date.now(),
      displayFreq: displayFreq
    });

    localStorage.setItem(blockedPopupsAndBannersKey, JSON.stringify(banners));
  }

  function _addToClosedPopups(bannerData) {
    var popups;
    var id = bannerData['id'];

    // нет попапов или есть
    if (popups = localStorage.getItem(closedPopupsCounterKey)) {
      popups = JSON.parse(popups);
      if (typeof popups[id] === "undefined")
        popups[id] = 1;
      else
        popups[id] = +popups[id] + 1;

      if (+popups[id] > 4) {
        delete popups[id];
        _addToBlockedBanners(bannerData);
      }
    } else {
      popups = {};
      popups[id] = 1;
    }

    localStorage.setItem(closedPopupsCounterKey, JSON.stringify(popups));
  }

  function _commonBlockPopups() {
    localStorage.setItem(commonPopupBlockKey, Date.now());
  }

  function _getBannersToExclude() {
    if (!localStorage.getItem(blockedPopupsAndBannersKey))
      return false;

    var returnArray = [];
    var banners = localStorage.getItem(blockedPopupsAndBannersKey);
    banners = JSON.parse(banners);

    banners.forEach(function (banner, idx) {
      // Добавим для исключения
      if (banner.created + banner.displayFreq > Date.now())
        returnArray.push(banner.id);
      // Иначе удалим из массива
      else
        banners.splice(idx, 1);
    });

    // Обновим storage
    localStorage.setItem(blockedPopupsAndBannersKey, JSON.stringify(banners));

    if (returnArray.length < 1)
      return false;

    return returnArray.join();
  }

  function _sendEventToServer(bannerData, actionType) {

    try {
      var banner_id = bannerData['id'];

      if (actionType === 'interaction') {
        _addToBlockedBanners(bannerData);
      }

      var dataLayerActionType = null;

      if (actionType === 'view') {
        dataLayerActionType = 'Просмотр';
      }
      else if (actionType === 'interaction') {
        dataLayerActionType = 'Взаимодействие';
      }

      $.ajax({
        type: "POST",
        url: serverUrl + '/api/redis/increment',
        data: JSON.stringify({
          banner_id: banner_id,
          device: device, //mobile or desktop
          type: actionType // view or interaction
        }),
        timeout: 5000,
        success: function (response) {
        },
        error: function (error) {
          console.warn(error);
        },
        dataType: 'json',
        contentType: 'application/json; charset=UTF-8'
      });

      var eventCat = '';

      if (bannerData['display_type'] === 'static')
        eventCat = 'Таргетированные баннеры и формы внутри статей';
      else
        eventCat = 'Лайфхакер попапы';

      // https://youtrack.lifehacker.ru/issue/WP_THEME-94
      if (dataLayerActionType !== 'Просмотр') {
        window.dataLayer.push({
          event: 'passEventToGa',
          eventCategory: eventCat,
          eventAction: dataLayerActionType + ' ' + device,
          eventLabel: banner_id,
          eventValue: 1
        });
      }
    } catch (e) {}
  }

  function _elementInViewport(el) {
    var top = el.offsetTop;
    var left = el.offsetLeft;
    var width = el.offsetWidth;
    var height = el.offsetHeight;

    while (el.offsetParent) {
      el = el.offsetParent;
      top += el.offsetTop;
      left += el.offsetLeft;
    }

    return (
        top >= window.pageYOffset &&
        left >= window.pageXOffset &&
        (top + height) <= (window.pageYOffset + window.innerHeight) &&
        (left + width) <= (window.pageXOffset + window.innerWidth)
    );
  }

  function _asyncAlert(msg) {
    setTimeout(function () {
      alert(msg);
    }, 0);
  }

});

